import Card from "./Card";

const cardComponent = {
  img: "./images/image-qr-code.png",
  title: "Improve your front-end skills by building projects",
  description:
    "can the QR code to visit Frontend Mentor and take your coding skills to the next level",
};

function App() {
  const title = "Cho Quan";
  return (
    <div className="App">
      <section>
        <Card img={cardComponent.img} title={cardComponent.title} author ={cardComponent.description}/>
      </section>
    </div>
  );
}

export default App;
